[SysClientCacheDataMethodAttribute(true)]
display UnitOfMeasureReportingText purchUnitTxt()
{
    VendRORReturnNoteJour returnNoteJour = this.vendRORReturnNoteJour();
    PurchTable purchTable;
    VendTable vendTable;

    if (returnNoteJour.LanguageId)
    {
        return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
            UnitOfMeasure::unitOfMeasureIdBySymbol(this.PurchUnit),
            returnNoteJour.LanguageId);
    }

    purchTable = PurchTable::find(returnNoteJour.PurchId);
    if (purchTable.LanguageId)
    {
        return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
            UnitOfMeasure::unitOfMeasureIdBySymbol(this.PurchUnit),
            purchTable.LanguageId);
    }

    vendTable = VendTable::find(this.vendRORReturnNoteJour().InvoiceAccount);
    if (vendTable.languageId())
    {
        return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
            UnitOfMeasure::unitOfMeasureIdBySymbol(this.PurchUnit),
            vendTable.languageId());
    }

    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.PurchUnit),
        CompanyInfo::languageId());
}

