/// <summary>
///    Returns the unposted invoiced quantity in inventory U of M for the current record.
/// </summary>
/// <param name="_excludeParmId">
///    A <c>parmId</c> value that identifies the records that are to be excluded from the calculation;
///    optional.
/// </param>
/// <returns>
///    The total unposted invoiced quantity for the current packing slip expressed in inventory U of M.
/// </returns>
public display UnpostedInvoiceInventQty unpostedInvoiceInventQty(ParmId _excludeParmId = '')
{
    return this.unpostedInvoiceInventQtyServer(_excludeParmId);
}

private server UnpostedInvoiceInventQty unpostedInvoiceInventQtyServer(ParmId _excludeParmId = '')
{
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;
    VendInvoiceInfoLine     vendInvoiceInfoLine;
    VendInvoiceInfoSubLine  vendInvoiceInfoSubLine;
    UnpostedInvoiceInventQty unpostedInvoiceInventQty;

    // Total the quantity from active invoices first
    select sum(InventNow) from parmSubLine
    where parmSubLine.JournalRefTableId == this.TableId
    &&    parmSubLine.JournalRefRecId == this.RecId
    &&    parmSubLine.ParmId != '' && // only active invoices
            (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
        where parmLine.RecId == parmSubLine.LineRefRecId
            exists join parmTable
            where parmTable.ParmId == parmLine.ParmId
            &&    parmTable.TableRefId == parmLine.TableRefId
            &&  (parmTable.Ordering == DocumentStatus::Invoice ||
                 parmTable.Ordering == DocumentStatus::ApproveJournal)
            &&   parmTable.ParmJobStatus == ParmJobStatus::Waiting;

    unpostedInvoiceInventQty = parmSubLine.InventNow;

    // Add in the quantity from saved invoices but don't include the quantity from active
    parmLine = null;
    select sum(InventNow) from vendInvoiceInfoSubLine
        where vendInvoiceInfoSubLine.JournalRefRecId == this.RecId
        &&    vendInvoiceInfoSubLine.JournalRefTableId == this.TableId
        &&    vendInvoiceInfoSubLine.ParmId == '' // only saved invoices
            exists join vendInvoiceInfoLine
            where vendInvoiceInfoLine.RecId == vendInvoiceInfoSubLine.LineRefRecId;

    unpostedInvoiceInventQty += vendInvoiceInfoSubLine.InventNow;

    return unpostedInvoiceInventQty;
}

/// <summary>
///    Returns the unposted invoiced quantity in purchasing U of M for the current record.
/// </summary>
/// <param name="_excludeParmId">
///    A <c>parmId</c> value that identifies the records that are to be excluded from the calculation;
///    optional.
/// </param>
/// <returns>
///    The total unposted invoiced quantity for the current packing slip expressed in purchasing U of M.
/// </returns>
[SysClientCacheDataMethodAttribute(true)]
public display UnpostedInvoicePurchQty unpostedInvoicePurchQty(ParmId _excludeParmId = '')
{
    return this.unpostedInvoicePurchQtyServer(_excludeParmId);
}

private server UnpostedInvoicePurchQty unpostedInvoicePurchQtyServer(ParmId _excludeParmId = '')
{
    VendInvoiceInfoTable    parmTable;
    VendInvoiceInfoLine     parmLine;
    VendInvoiceInfoSubLine  parmSubLine;
    VendInvoiceInfoLine     vendInvoiceInfoLine;
    VendInvoiceInfoSubLine  vendInvoiceInfoSubLine;
    UnpostedInvoicePurchQty unpostedInvoicePurchQty;

    select sum(ReceiveNow) from parmSubLine
        where parmSubLine.JournalRefTableId == this.TableId &&
              parmSubLine.JournalRefRecId == this.RecId &&
              parmSubLine.ParmId != '' && // only active invoices
              (!_excludeParmId || parmSubLine.ParmId != _excludeParmId)
        exists join parmLine
        where parmLine.RecId == parmSubLine.LineRefRecId
        exists join parmTable
        where parmTable.ParmId == parmLine.ParmId &&
              parmTable.TableRefId == parmLine.TableRefId &&
              (parmTable.ParmJobStatus == ParmJobStatus::Waiting ||
               parmTable.ParmJobStatus == ParmJobStatus::ContainErrors);

    unpostedInvoicePurchQty = parmSubLine.ReceiveNow;

    // Add in the quantity from VendInvoiceInfo* but don't include the quantity that is duplicated by PurchParm*
    parmLine = null;

    select sum(ReceiveNow) from vendInvoiceInfoSubLine
        where vendInvoiceInfoSubLine.JournalRefRecId == this.RecId &&
              vendInvoiceInfoSubLine.JournalRefTableId == this.TableId &&
              vendInvoiceInfoSubLine.ParmId == '' // only saved invoices
        exists join vendInvoiceInfoLine
        where vendInvoiceInfoLine.RecId == vendInvoiceInfoSubLine.LineRefRecId;

    unpostedInvoicePurchQty += vendInvoiceInfoSubLine.ReceiveNow;

    return unpostedInvoicePurchQty;
}

VendRORReturnNoteJour  vendRORReturnNoteJour(boolean  _update = false)
{
    return VendRORReturnNoteJour::findRecId(this.VendReturnNote, _update);
}

public static client server VendRORReturnNoteTrans findRecId(RecId     _recId,
                                                             boolean   _forUpdate = false)
{
    VendRORReturnNoteTrans returnNoteTrans;

    if (_recId)
    {
        returnNoteTrans.selectForUpdate(_forUpdate);

        select returnNoteTrans
        where returnNoteTrans.RecId == _recId;
    }

    return returnNoteTrans;
}
